
create table history
(
	实验编号 int primary key identity(20170000,1),
	行数 int ,
	列数 int ,
	波段个数 int,
	图片格式 char(30),
	样本个数 int,
	地物个数 int,
	文件路径 nvarchar(100), 
	区分地物 text,
	海岸线 text
)
create table see
(
	实验编号 int primary key identity(20170000,1),
	实验名称 nvarchar(50),
	实验评价 nvarchar(10),
	实验时间 varchar(50),
)

create table G_sample
(
	实验编号 int primary key identity(20170000,1),
	地物个数 int,
	Ground_1 nvarchar(100),
	rule_1   text ,
	Ground_2 nvarchar(100),
	rule_2   text ,
	Ground_3 nvarchar(100),
	rule_3   text ,
	Ground_4 nvarchar(100),
	rule_4   text ,
	Ground_5 nvarchar(100),
	rule_5   text ,
	Ground_6 nvarchar(100),
	rule_6   text ,
	Ground_7 nvarchar(100),
	rule_7   text ,

)

